: it’s raining hard in LA & it feels approp because today we lose Meredith Grey. i strongly feel like today should be a national holiday. i’ll be deeply mourning for some time.

i started watching Grey’s on March 27, 2005 during my 3rd year of college in my Greenwich Village apartment on a TV that had a built in VCR no less. i was immediately taken by this deeply complex, flawed, ambitious, “dark & twisty” character. whether it was her childhood trauma, her secret love triangle, her abandonment issues, her rule breaking, her intense relationship with Bailey, or her drive ; i felt like i was watching my (at the time) 21 year old self play out on the screen in front of me. 

i’ll never forget that 1st ep when Bailey said, “i have 5 rules” and Meredith replied, “you said 5 rules that was only 4”, my best friend Michael, (McDreamy) looked at me & said, “oh, i’m calling you Mer from now on.” every episode he and i would look at each other jaw dropped in disbelief at the similarities. to this day, Meredith’s life oddly constantly mirrors or foreshadows my own. today, even i, start a new chapter too. 

when people say they gave up when “george died” or when “mcdreamy died” or when “meredith got covid” i know they’re not my people. when people say the show is too dramatic i always want to scream, “actually it’s the most accurate depiction of my life.” only a show that has gone on for 18 years can develop a character as rich & as layered as Meredith Grey. only a show that’s endured 19 szns can build the complex & realistic ebbs & flows of relationships that possess the depth of history that we can all understand & treasure. there is no substitute for time & Grey’s has had all of it. her evolution is my only reference for superhuman resilience. 

@shondarhimes thank you for writing a female lead with such dimension. for shattering glass ceilings & doing what no one else was doing at the time. thank you (even though i despised you at times) for taking nearly every single beloved person away from the character with deep abandonment issues to show Meredith Grey all she ever needed was herself. 

@ellenpompeo - no matter the where, YOU are the sun. ☀️ #meredithgrey

: hey Siri, cue “They Call Me Mother“ by Rupaul. 💁🏼‍♀️

i am so unbelievable proud of the PACE Juniors. i’m deeply attached to all 30 of these special souls and they have knowingly & proudly claimed a great deal of real estate in my heart. thank you for your hunger, your focus, and your trust this semester that allowed me to push you physically and emotionally to places you thought you couldn’t go. you delivered “For My Help” last night on a level i had only dreamed of and hasn’t previously been done before. i sat in the audience shaking from the authenticity & fire you each brought to the stage. to hear people’s very emotional reactions afterward was testament to YOU. thank you for telling this story and thank you for your love. you 30 make me feel aligned with my purpose and that is a gift that i will always love you for. your futures are more bright than you could ever imagine. 💜

@chris_critelli thank you again for your assistance. my belief in you knows no bounds. thank you for leading with kindness while still maintaining the intensity and focus required for the work. 

@annieeebeee 🐝 there was no one that was more prepared to take on role of Dance Captain. thanks for having the work ethic you do. pretty special that we got to work together in this chapter of your life. i love you. 

big congratulations to @scotty_hislop @dom_chaiduang @jillymeyers #america @brandonleff & @rhondakmiller on your contributions to the dancers and the evening. they are so fortunate to learn from the very best. thanks to @claireelizabethross & @katelin_macdonald for all you do. huge thanks to michael for hands down being the best lighting designer i’ve ever worked with. 

and finally, rhonda, bestie …. the program that you have created is nothing short of remarkable. the faculty, resources, and experience you give them is unparalleled. to see a college dance program envoke & encourage individuality while embrace every genre as equally as important as the next has been healing, personally, & inspiring, professionally. i know how hard you work & last night was a testament to that work & your vision. PACE is most definitely the PLACE. 💙💛

@pacecommercialdance

: the cover photo of this carousel is poor quality but truly always one of my most favorite high quality moments of the year. it’s when @jacobflynn sits next to me at dress rehearsal and gets to see the opening number for the first time. there’s always tears but this year it was a jaw dropped look of awe as we both looked at each other attempting to process what just happened. our brain trying to catch up with our vision is a moment i’ll always treasure.

@jacobflynn - thank you for trusting me. for letting me run with anything and everything and always placing complete faith in my instinct and vision. you are truly one of my best friends, so to be able to work together in the way we do is truly special. thank you for always taking care of me and everyone i love. so proud of all that you’ve grown @in10sitydance to be. 

@dancingsadie & @camillespence_ i am so unbelievably proud of the 2 of you. to watch you develop your leadership and agency this week made me a very proud mentor. thank you for leading with kindness, for loving the kids, for caring so deeply, and for the MANY, MANY laughs. what happened on stage yesterday was a testament to the environment you helped me create. i love you, both tremendously. 💜

to the dancers of “Titanium” …. the pride and love i have for every single one of you is still bursting out of my chest. thank you for giving up every moment of your free time whilst competing to be a part of this incredible process culminating in the most unforgettable performance. about half way through the piece, i sat back in my chair and just watched you in awe with tears streaming down my face. thank you for understanding the vision, dropping studio lines, and working together to create this piece. thank you for being brave and daring greatly enough to play in my arena. i will never forget you. 🫶🏼

*and had to squeeze in a photo of my grown 1st dance son - @blakepiatczyc. proud of you and love you v much. 💜

